import React, { Component } from "react";
import { Spinner } from "react-bootstrap";
import "./Spinner.css";
const Spin = (props) => {
  return (
    <React.Fragment>
      <div className="spin border">
        <Spinner size="lg" animation="border" role="status">
          <span className="sr-only">Loading...</span>
        </Spinner>
      </div>
    </React.Fragment>
  );
};

export default Spin;
